import { createSelector } from 'reselect';
import get from 'lodash/get';

const _getFeatures = state => state.features;
export const getFeatures = createSelector(_getFeatures, features => features);
export const getEnableNotificationDrawer = createSelector(getFeatures, features => get(features, 'enableNotificationDrawer', false));
